    void replace_el(node* root, int Li, int Ri, int i, int x) {
        if (root == nullptr) return;

        if (Li == Ri) {  // Если это лист, и его индекс == i
            if (i == Li) {
                root->val = x;
            }
            return;
        }

        int mid = (Li + Ri) / 2;
        if (i < mid) {
            replace_el(root->l, Li, mid, i, x);  // Ищем в левом поддереве
        } else {
            replace_el(root->r, mid + 1, Ri, i, x);  // Ищем в правом поддереве
        }
    }
};

